Недвижимое имущество магистральных газопроводов и сооружений, являющихся их неотъемлемой частью, объектов газодобычи, объектов производства и хранения гелия, для которых одновременно выполняются следующие условия:
- объекты впервые введены в эксплуатацию в налоговые периоды начиная с 1 января 2015 года;
- объекты расположены полностью или частично в границах Республики Саха (Якутия), Иркутской или Амурской области;
- объекты принадлежат в течение всего налогового периода на праве собственности организациям, указанным в подпункте 1 пункта 5 статьи 342.4 Кодекса.

Объекты магистральных газопроводов, объектов газодобычи, объектов производства и хранения гелия; объекты, предусмотренные техническими проектами разработки месторождений полезных ископаемых и иной проектной документацией на выполнение работ, связанных с пользованием участками недр, или проектной документацией объектов капитального строительства, и необходимых для обеспечения функционирования объектов недвижимого имущества магистральных газопроводов, объектов газодобычи, объектов производства и хранения гелия, при условии одновременного выполнения для таких объектов следующих требований:
объекты впервые введены в эксплуатацию в налоговые периоды начиная с 01 января 2015;
объекты расположены полностью или частично в границах Республики Саха (Якутия), Иркутской или Амурской области;
объекты принадлежат в течение всего налогового периода на праве собственности организациям, указанным в подпункте 1 пункта 5 статьи 342.4 Кодекса.

Objects of main gas pipelines, gas extraction facilities, facilities of helium production and storage; facilities required by technical projects for mining of mineral deposits and by other design documentation to perform works connected with subsoil area using, or by design documentation of capital construction objects; facilities required to make operational real estate of main gas pipelines, gas extraction facilities, facilities of helium production and storage, for which the following conditions are fulfilled all at once:
- the objects are commissioned for the first time to fiscal periods starting with 01/01/2015;
- the objects are fully or partially located within the Sakha (Yakutia) Republic, Irkutsk Oblast or Amur Oblast;
- the objects are owned by companies specified in subclause 1 of clause 5 of article 342.4 of the Code during the whole fiscal period.

Объекты магистральных газопроводов, объектов газодобычи, объектов производства и хранения гелия; объекты, предусмотренные техническими проектами разработки месторождений полезных ископаемых и иной проектной документацией на выполнение работ, связанных с пользованием участками недр, или проектной документацией объектов капитального строительства, и необходимых для обеспечения функционирования объектов недвижимого имущества магистральных газопроводов, объектов газодобычи, объектов производства и хранения гелия, при условии одновременного выполнения для таких объектов следующих требований:
объекты впервые введены в эксплуатацию в налоговые периоды начиная с 1 января 2015 года;
объекты расположены полностью или частично в границах Республики Саха (Якутия), Иркутской или Амурской области;
объекты принадлежат в течение всего налогового периода на праве собственности организациям, указанным в подпункте 1 пункта 5 статьи 342.4 Налогового кодекса Российской Федерации (далее - Кодекс)

Objects of main gas pipelines, gas extraction facilities, facilities of helium production and storage; facilities required by technical projects for mining of mineral deposits and by other design documentation to perform works connected with subsoil area using, or by design documentation of capital construction objects; facilities required to make operational real estate of main gas pipelines, gas extraction facilities, facilities of helium production and storage, for which the following conditions are fulfilled all at once:
- the objects are commissioned for the first time to fiscal periods starting with 01/01/2015;
- the objects are fully or partially located within the Sakha (Yakutia) Republic, Irkutsk Oblast or Amur Oblast;
- the objects are owned by companies specified in subclause 1 of clause 5 of article 342.4 of the Tax Code of the Russian Federation (hereinafter referred to as the Code) during the whole fiscal period.
